import React from 'react'

export default function Calculator() {
    const add=(a,b)=>{
        return a+b
    }
    const mul=(a,b)=>{
        return a*b
    }
    const sub=(a,b)=>{
        return a-b
    }
    const div=(a,b)=>{
        return (a/b).toFixed(2)
    }       
}
